import React, { Component } from 'react'
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import Markets from './markets';
//import Banner from 'react-banner'
import './banner.css'



function Grafits() {
  return <h2>About</h2>;
}

function Suport() {
  return <h2>Users</h2>;
}

function Banner () {

      return(
        <Router>
          <div className="banner">
            <img
              className="img"
              src="./images/GrafiTTraders.png"
              alt=""
            />
              <h2 className="logo">GrafiTTraders</h2>
          <nav>
            <ul>
              <li className="banner-bottom">
                <Link to="/">Markets</Link>
              </li>
              <li className="banner-bottom">
                <Link to="/about/">Grafits</Link>
              </li>
              <li className="banner-bottom">
                <Link to="/users/">Suport</Link>
              </li>
            </ul>
          </nav>

          <Route path="/" exact component={Markets} />
          <Route path="/about/" component={Grafits} />
          <Route path="/users/" component={Suport} />
        </div>
      </Router>

    )

}
export default Banner;
